package com.example.MyCollection.Models;/** * Created by lilian on 10/17/14. */public class User {    String fullName;    String Password;    String email;    public String getPassword() {        return Password;    }    public void setPassword(String password) {        Password = password;    }    public String getFullName() {        return fullName;    }    public void setFullName(String fullName) {        this.fullName = fullName;    }    public String getEmail() {        return email;    }    public void setEmail(String email) {        this.email = email;    }}